import React from "react";
import theme from "../stylesheet";
import { ThemeProvider } from "styled-components";
import { WorkConteiner, ConteinerText } from "./WorkSectionElements";

const WorkConteinerComponent = () => {
  return (
    <ThemeProvider theme={theme}>
      <WorkWrapper>
        <WorkConteiner>
          <ConteinerText>3D Printing</ConteinerText>
          <img
            alt=""
            src="https://static.overlay-tech.com/assets/19e18b88-b3b4-457c-b3ac-1c70ddb804eb.png"
          />
        </WorkConteiner>

        <WorkConteiner>
          <ConteinerText>3D Printing</ConteinerText>
          <img
            alt=""
            src="https://static.overlay-tech.com/assets/19e18b88-b3b4-457c-b3ac-1c70ddb804eb.png"
          />
        </WorkConteiner>
      </WorkWrapper>
    </ThemeProvider>
  );
};

export default WorkConteinerComponent;
